import React from 'react';

const MakeOrderItem = () => {
    return (
        <div className="makeOrder">
            <div className="inputs">
                <h3 className="medium_title">
                    Замовити переклад або редагування
                </h3>
                <fieldset>asd</fieldset>
                <div className="area">
                    <textarea className="area_text">
                    </textarea>
                </div>
            </div>
        </div>
    );
};

export default MakeOrderItem;
